class CustomPageControl: UIPageControl {
    var activeImage: UIImage?
    var inactiveImage: UIImage?

    override func awakeFromNib() {
        super.awakeFromNib()
        updateDots()
    }

    override func layoutSubviews() {
        super.layoutSubviews()
        updateDots()
    }

    func updateDots() {
        if let activeImage = activeImage, let inactiveImage = inactiveImage {
            for (index, subview) in subviews.enumerated() {
                if let imageView = findImageView(in: subview) {
                    imageView.image = (index == currentPage) ? activeImage : inactiveImage
                } else {
                    let imageView = UIImageView(image: (index == currentPage) ? activeImage : inactiveImage)
                    imageView.frame = subview.bounds
                    subview.addSubview(imageView)
                }
            }
        }
    }

    private func findImageView(in view: UIView) -> UIImageView? {
        if view is UIImageView {
            return view as? UIImageView
        } else {
            for subview in view.subviews {
                if let imageView = findImageView(in: subview) {
                    return imageView
                }
            }
        }
        return nil
    }
}

