import Foundation

enum NetworkError: Error {
    case invalidURL
    case dataFetchError
}

func fetchData(from urlString: String, completion: @escaping (Result<Data, NetworkError>) -> Void) {
    guard let url = URL(string: urlString) else {
        completion(.failure(.invalidURL))
        return
    }

    let task = URLSession.shared.dataTask(with: url) { data, response, error in
        if let data = data {
            completion(.success(data))
        } else {
            completion(.failure(.dataFetchError))
        }
    }

    task.resume()
}

// Usage
fetchData(from: "https://api.example.com/data") { result in
    switch result {
    case .success(let data):
        print("Fetched data: \(data)")
    case .failure(let error):
        print("Error fetching data: \(error)")
    }
}

import UIKit

func downloadImage(from url: URL, completion: @escaping (Result<UIImage, Error>) -> Void) {
    let task = URLSession.shared.dataTask(with: url) { data, response, error in
        if let error = error {
            completion(.failure(error))
            return
        }

        guard let data = data, let image = UIImage(data: data) else {
            let error = NSError(domain: "ImageDownload", code: -1, userInfo: [NSLocalizedDescriptionKey: "Invalid image data"])
            completion(.failure(error))
            return
        }

        completion(.success(image))
    }

    task.resume()
}

extension UIImageView {
    func setImage(from url: URL) {
        downloadImage(from: url) { [weak self] result in
            DispatchQueue.main.async {
                switch result {
                case .success(let image):
                    self?.image = image
                case .failure(let error):
                    print("Error downloading image: \(error)")
                }
            }
        }
    }
}

