import Foundation

struct ExampleModel: Codable {
    let id: Int
    let name: String
}

func fetchJSONData(from url: URL, completion: @escaping (ExampleModel?, Error?) -> Void) {
    URLSession.shared.dataTask(with: url) { data, response, error in
        guard let data = data, error == nil else {
            DispatchQueue.main.async { completion(nil, error) }
            return
        }

        do {
            let decoder = JSONDecoder()
            let jsonData = try decoder.decode(ExampleModel.self, from: data)
            DispatchQueue.main.async { completion(jsonData, nil) }
        } catch {
            DispatchQueue.main.async { completion(nil, error) }
        }
    }.resume()
}

import Foundation

func saveFileToLocalStorage(data: Data, fileName: String) -> Bool {
    guard let documentsDirectory = FileManager.default.urls(for: .documentDirectory, in: .userDomainMask).first else {
        return false
    }

    let fileURL = documentsDirectory.appendingPathComponent(fileName)

    do {
        try data.write(to: fileURL)
        return true
    } catch {
        print("Error saving file: \(error)")
        return false
    }
}

import Foundation

func retrieveFileFromLocalStorage(fileName: String) -> Data? {
    guard let documentsDirectory = FileManager.default.urls(for: .documentDirectory, in: .userDomainMask).first else {
        return nil
    }

    let fileURL = documentsDirectory.appendingPathComponent(fileName)

    do {
        let data = try Data(contentsOf: fileURL)
        return data
    } catch {
        print("Error retrieving file: \(error)")
        return nil
    }
}

import Foundation

func deleteFileFromLocalStorage(fileName: String) -> Bool {
    let fileManager = FileManager.default
    guard let documentsDirectory = fileManager.urls(for: .documentDirectory, in: .userDomainMask).first else {
        return false
    }

    let fileURL = documentsDirectory.appendingPathComponent(fileName)

    do {
        try fileManager.removeItem(at: fileURL)
        return true
    } catch {
        print("Error deleting file: \(error)")
        return false
    }
}

