import CoreLocation

func location(at distance: CLLocationDistance, from startLocation: CLLocation, direction: CLLocationDirection) -> CLLocation {
    let distanceRadians = distance / 6_367_000.0
    let bearingRadians = direction * .pi / 180.0

    let startLatitudeRadians = startLocation.coordinate.latitude * .pi / 180.0
    let startLongitudeRadians = startLocation.coordinate.longitude * .pi / 180.0

    let endLatitudeRadians = asin(sin(startLatitudeRadians) * cos(distanceRadians) + cos(startLatitudeRadians) * sin(distanceRadians) * cos(bearingRadians))
    let endLongitudeRadians = startLongitudeRadians + atan2(sin(bearingRadians) * sin(distanceRadians) * cos(startLatitudeRadians), cos(distanceRadians) - sin(startLatitudeRadians) * sin(endLatitudeRadians))

    let endLatitude = endLatitudeRadians * 180.0 / .pi
    let endLongitude = endLongitudeRadians * 180.0 / .pi

    return CLLocation(latitude: endLatitude, longitude: endLongitude)
}

