func saveImageToPhotoLibrary(_ image: UIImage, completion: @escaping (Result<Void, Error>) -> Void) {
    PHPhotoLibrary.requestAuthorization { (status) in
        switch status {
        case .authorized:
            PHPhotoLibrary.shared().performChanges({
                PHAssetChangeRequest.creationRequestForAsset(from: image)
            }) { (success, error) in
                DispatchQueue.main.async {
                    if let error = error {
                        completion(.failure(error))
                    } else {
                        completion(.success(()))
                    }
                }
            }
        case .denied, .restricted, .notDetermined:
            DispatchQueue.main.async {
                completion(.failure(NSError(domain: "PhotoLibraryError", code: -1, userInfo: [NSLocalizedDescriptionKey: "Unauthorized access to photo library"])))
            }
        @unknown default:
            fatalError("Unknown authorization status")
        }
    }
}

