        percentageLabel.textAlignment = .center
        percentageLabel.font = UIFont.systemFont(ofSize: 20)
        addSubview(percentageLabel)
    }

    override func layoutSubviews() {
        super.layoutSubviews()
        backgroundLayer.frame = bounds
        progressLayer.frame = bounds
        percentageLabel.frame = bounds

        let center = CGPoint(x: bounds.midX, y: bounds.midY)
        let radius = min(bounds.width, bounds.height) / 2 - progressLayer.lineWidth / 2
        let startAngle = -CGFloat.pi / 2
        let endAngle = startAngle + 2 * CGFloat.pi

        let backgroundPath = UIBezierPath(arcCenter: center, radius: radius, startAngle: startAngle, endAngle: endAngle, clockwise: true)
        backgroundLayer.path = backgroundPath.cgPath

        let progressPath = UIBezierPath(arcCenter: center, radius: radius, startAngle: startAngle, endAngle: startAngle + progress * 2 * CGFloat.pi, clockwise: true)
        progressLayer.path = progressPath.cgPath
    }

    private func updateProgress() {
        let progressPath = UIBezierPath(arcCenter: CGPoint(x: bounds.midX, y: bounds.midY), radius: min(bounds.width, bounds.height) / 2 - progressLayer.lineWidth / 2, startAngle: -CGFloat.pi / 2, endAngle: -CGFloat.pi / 2 + progress * 2 * CGFloat.pi, clockwise: true)
        progressLayer.path = progressPath.cgPath
        percentageLabel.text = String(format: "%.0f%%", progress * 100)
    }
}

