struct CustomData: Codable {
    let id: Int
    let name: String
}

func fetchData(completion: @escaping (Result<[CustomData], Error>) -> Void) {
    let url = URL(string: "https://api.example.com/data")!
    let task = URLSession.shared.dataTask(with: url) { (data, response, error) in
        if let error = error {
            completion(.failure(error))
            return
        }

        guard let data = data else {
            let error = NSError(domain: "DataError", code: -1, userInfo: [NSLocalizedDescriptionKey: "Invalid Data"])
            completion(.failure(error))
            return
        }

        do {
            let decoder = JSONDecoder()
            let decodedData = try decoder.decode([CustomData].self, from: data)
            completion(.success(decodedData))
        } catch {
            completion(.failure(error))
        }
    }
    task.resume()
}

