class CircularProgressBar: UIView {
    private var progressLayer: CAShapeLayer!

    var progress: CGFloat {
        didSet {
            setNeedsDisplay()
        }
    }

    var progressColor: UIColor {
        didSet {
            progressLayer.strokeColor = progressColor.cgColor
        }
    }

    var progressThickness: CGFloat {
        didSet {
            progressLayer.lineWidth = progressThickness
        }
    }

    override init(frame: CGRect) {
        self.progress = 0
        self.progressColor = .blue
        self.progressThickness = 5
        super.init(frame: frame)
        setup()
    }

    required init?(coder aDecoder: NSCoder) {
        self.progress = 0
        self.progressColor = .blue
        self.progressThickness = 5
        super.init(coder: aDecoder)
        setup()
    }

    private func setup() {
        progressLayer = CAShapeLayer()
        progressLayer.strokeColor = progressColor.cgColor
        progressLayer.lineWidth = progressThickness
        progressLayer.fillColor = UIColor.clear.cgColor
        progressLayer.lineCap = .round
        layer.addSublayer(progressLayer)
    }

    override func draw(_ rect: CGRect) {
        let center = CGPoint(x: bounds.midX, y: bounds.midY)
        let radius = min(bounds.width, bounds.height) / 2 - progressThickness / 2
        let startAngle = CGFloat(-Double.pi / 2)
        let endAngle = startAngle + 2 * CGFloat(Double.pi) * progress

        let path = UIBezierPath(arcCenter: center, radius: radius, startAngle: startAngle, endAngle: endAngle, clockwise: true)
        progressLayer.path = path.cgPath
    }

    func animateProgress(to value: CGFloat, duration: TimeInterval) {
        progress = value
        let animation = CABasicAnimation(keyPath: "strokeEnd")
        animation.fromValue = 0
        animation.toValue = value
        animation.duration = duration
        animation.isRemovedOnCompletion = false
        animation.fillMode = .forwards
        progressLayer.add(animation, forKey: "progressAnimation")
    }
}

