class StarRatingControl: UIControl {
    private var starButtons: [UIButton] = []
    private let numberOfStars = 5
    private let starSize: CGSize = CGSize(width: 44, height: 44)
    private let starSpacing: CGFloat = 8

    var rating: Int = 0 {
        didSet {
            updateButtonSelectionStates()
        }
    }

    override init(frame: CGRect) {
        super.init(frame: frame)
        setupButtons()
    }

    required init?(coder: NSCoder) {
        super.init(coder: coder)
        setupButtons()
    }

    private func setupButtons() {
        for _ in 0..<numberOfStars {
            let button = UIButton()
            button.setImage(UIImage(named: "emptyStar"), for: .normal)
            button.setImage(UIImage(named: "filledStar"), for: .selected)

            button.addTarget(self, action: #selector(ratingButtonTapped(button:)), for: .touchUpInside)

            starButtons.append(button)
            addSubview(button)
        }
    }

    override func layoutSubviews() {
        let buttonWidth = starSize.width + starSpacing
        var buttonFrame = CGRect(origin: .zero, size: starSize)

        for (index, button) in starButtons.enumerated() {
            buttonFrame.origin.x = CGFloat(index) * buttonWidth
            button.frame = buttonFrame
        }
    }

    override var intrinsicContentSize: CGSize {
        let width = CGFloat(numberOfStars) * starSize.width + CGFloat(numberOfStars - 1) * starSpacing
        return CGSize(width: width, height: starSize.height)
    }

    @objc private func ratingButtonTapped(button: UIButton) {
        guard let index = starButtons.firstIndex(of: button) else { return }
        rating = index + 1

        sendActions(for: .valueChanged)
    }

    private func updateButtonSelectionStates() {
        for (index, button) in starButtons.enumerated() {
            button.isSelected = index < rating
        }
    }
}

