func compressImage(_ image: UIImage, maxFileSize: Int) -> Data? {
    let maxFileSizeInBytes = maxFileSize * 1024
    var compression: CGFloat = 1.0
    var imageData = image.jpegData(compressionQuality: compression)

    guard var initialData = imageData else {
        return nil
    }

    var lower: CGFloat = 0.0
    var upper: CGFloat = 1.0

    while initialData.count > maxFileSizeInBytes && abs(upper - lower) > 0.001 {
        compression = (lower + upper) / 2
        imageData = image.jpegData(compressionQuality: compression)

        guard let newData = imageData else {
            return nil
        }

        if newData.count > maxFileSizeInBytes {
            lower = compression
        } else {
            upper = compression
        }

        initialData = newData
    }

    return initialData
}

