class CustomSlider: UISlider {
    private var tooltip: UILabel?

    override init(frame: CGRect) {
        super.init(frame: frame)
        setup()
    }

    required init?(coder: NSCoder) {
        super.init(coder: coder)
        setup()
    }

    private func setup() {
        addTarget(self, action: #selector(touchDown), for: .touchDown)
        addTarget(self, action: #selector(valueChanged), for: .valueChanged)
        addTarget(self, action: #selector(touchUp), for: [.touchUpInside, .touchUpOutside])
    }

    @objc private func touchDown() {
        showTooltip()
    }

    @objc private func valueChanged() {
        updateTooltip()
    }

    @objc private func touchUp() {
        hideTooltip()
    }

    private func showTooltip() {
        tooltip = UILabel()
        tooltip?.backgroundColor = .black
        tooltip?.textColor = .white
        tooltip?.alpha = 0.8
        tooltip?.layer.cornerRadius = 5
        tooltip?.clipsToBounds = true
        tooltip?.textAlignment = .center
        tooltip?.font = UIFont.systemFont(ofSize: 12)

        updateTooltip()
        guard let tooltip = tooltip else { return }
        addSubview(tooltip)
    }

    private func updateTooltip() {
        guard let tooltip = tooltip else { return }
        let value = Int(self.value)
        tooltip.text = "\(value)"
        tooltip.sizeToFit()
        tooltip.frame.size.width += 10
        tooltip.frame.size.height += 5
        tooltip.center = CGPoint(x: thumbCenterX(), y: bounds.midY - 30)
    }

    private func hideTooltip() {
        tooltip?.removeFromSuperview()
        tooltip = nil
    }

    private func thumbCenterX() -> CGFloat {
        let trackRange = bounds.width - thumbRect(forBounds: bounds, trackRect: trackRect(forBounds: bounds), value: 0).midX
        let startX = trackRect(forBounds: bounds).minX
        return startX + trackRange * CGFloat((value - minimumValue) / (maximumValue - minimumValue))
    }
}

