func createCircularProgressView(radius: CGFloat, strokeColor: UIColor, progress: CGFloat) -> UIView {
    let progressView = UIView()
    let circlePath = UIBezierPath(arcCenter: progressView.center, radius: radius, startAngle: -.pi / 2, endAngle: 2 * .pi - .pi / 2, clockwise: true)

    let backgroundLayer = CAShapeLayer()
    backgroundLayer.path = circlePath.cgPath
    backgroundLayer.fillColor = UIColor.clear.cgColor
    backgroundLayer.strokeColor = strokeColor.withAlphaComponent(0.3).cgColor
    backgroundLayer.lineWidth = 5

    let progressLayer = CAShapeLayer()
    progressLayer.path = circlePath.cgPath
    progressLayer.fillColor = UIColor.clear.cgColor
    progressLayer.strokeColor = strokeColor.cgColor
    progressLayer.lineWidth = 5
    progressLayer.strokeEnd = progress
    progressLayer.lineCap = .round

    progressView.layer.addSublayer(backgroundLayer)
    progressView.layer.addSublayer(progressLayer)

    return progressView
}

