func createAlertControllerWithTextField(title: String, message: String, placeholder: String, submitAction: @escaping (String) -> Void) -> UIAlertController {
    let alertController = UIAlertController(title: title, message: message, preferredStyle: .alert)
    alertController.addTextField { textField in
        textField.placeholder = placeholder
    }
    let submitButton = UIAlertAction(title: "Submit", style: .default) { _ in
        if let text = alertController.textFields?.first?.text {
            submitAction(text)
        }
    }
    alertController.addAction(submitButton)
    return alertController
}

