func scrollTo(_ scrollView: UIScrollView, to point: CGPoint, animated: Bool) {
    let contentOffset = CGPoint(x: min(max(point.x, 0), scrollView.contentSize.width - scrollView.bounds.width),
                                y: min(max(point.y, 0), scrollView.contentSize.height - scrollView.bounds.height))
    scrollView.setContentOffset(contentOffset, animated: animated)
}

