func twoSum(_ arr: [Int], target: Int) -> [Int] {
    var hashMap = [Int: Int]()

    for (index, number) in arr.enumerated() {
        let complement = target - number
        if let complementIndex = hashMap[complement] {
            return [complementIndex, index]
        }
        hashMap[number] = index
    }
    return []
}

