class ViewController: UIViewController {
    let motionManager = CMMotionManager()

    override func viewDidLoad() {
        super.viewDidLoad()
        setupMotionManager()
    }

    func setupMotionManager() {
        motionManager.accelerometerUpdateInterval = 0.1
        motionManager.startAccelerometerUpdates(to: OperationQueue.current!) { (data, error) in
            if let accelerometerData = data {
                if self.isShaking(data: accelerometerData) {
                    print("Device is shaking")
                }
            }
        }
    }

    func isShaking(data: CMAccelerometerData) -> Bool {
        let accelerationThreshold: Double = 1.3
        let userAcceleration = data.acceleration
        return abs(userAcceleration.x) > accelerationThreshold ||
               abs(userAcceleration.y) > accelerationThreshold ||
               abs(userAcceleration.z) > accelerationThreshold
    }
}

