func factorial(_ n: Int) -> Int {
    guard n >= 0 else {
        fatalError("Factorial is not defined for negative numbers.")
    }

    if n == 0 || n == 1 {
        return 1
    }

    return n * factorial(n - 1)
}

func fibonacci(_ n: Int) -> Int {
    if n == 0 {
        return 0
    } else if n == 1 {
        return 1
    } else {
        return fibonacci(n - 1) + fibonacci(n - 2)
    }
}

