func mergeSortedArrays(_ array1: [Int], _ array2: [Int]) -> [Int] {
    var mergedArray: [Int] = []
    var index1 = 0
    var index2 = 0

    while index1 < array1.count && index2 < array2.count {
        if array1[index1] < array2[index2] {
            mergedArray.append(array1[index1])
            index1 += 1
        } else {
            mergedArray.append(array2[index2])
            index2 += 1
        }
    }

    while index1 < array1.count {
        mergedArray.append(array1[index1])
        index1 += 1
    }

    while index2 < array2.count {
        mergedArray.append(array2[index2])
        index2 += 1
    }

    return mergedArray
}

func firstNonRepeatedCharacter(in string: String) -> Character? {
    var characterCount: [Character: Int] = [:]

    for character in string {
        characterCount[character, default: 0] += 1
    }

    for character in string {
        if characterCount[character] == 1 {
            return character
        }
    }

    return nil
}

