func factorial(_ n: Int) -> Int {
    if n <= 1 {
        return 1
    } else {
        return n * factorial(n - 1)
    }
}

func mergeSort(_ array: [Int]) -> [Int] {
    if array.count <= 1 {
        return array
    }

    let middleIndex = array.count / 2
    let leftArray = mergeSort(Array(array[0..<middleIndex]))
    let rightArray = mergeSort(Array(array[middleIndex..<array.count]))

    return merge(leftArray, rightArray)
}

func merge(_ left: [Int], _ right: [Int]) -> [Int] {
    var leftIndex = 0
    var rightIndex = 0
    var sortedArray: [Int] = []

    while leftIndex < left.count && rightIndex < right.count {
        if left[leftIndex] < right[rightIndex] {
            sortedArray.append(left[leftIndex])
            leftIndex += 1
        } else {
            sortedArray.append(right[rightIndex])
            rightIndex += 1
        }
    }

    while leftIndex < left.count {
        sortedArray.append(left[leftIndex])
        leftIndex += 1
    }

    while rightIndex < right.count {
        sortedArray.append(right[rightIndex])
        rightIndex += 1
    }

    return sortedArray
}

func stringsStartingWithPrefix(_ strings: [String], prefix: String) -> [String] {
    return strings.filter { $0.hasPrefix(prefix) }
}

func longestCommonPrefix(_ strs: [String]) -> String {
    if strs.isEmpty {
        return ""
    }

    var prefix = strs[0]

    for str in strs {
        while !str.hasPrefix(prefix) {
            prefix = String(prefix.dropLast())
            if prefix.isEmpty {
                return ""
            }
        }
    }

    return prefix
}

func flatten(_ nestedArray: [Any]) -> [Int] {
    var flattenedArray = [Int]()

    for element in nestedArray {
        if let intElement = element as? Int {
            flattenedArray.append(intElement)
        } else if let arrayElement = element as? [Any] {
            flattenedArray += flatten(arrayElement)
        }
    }

    return flattenedArray
}

func isValidIPv4Address(_ ipAddress: String) -> Bool {
    let components = ipAddress.split(separator: ".")

    if components.count != 4 {
        return false
    }

    for component in components {
        if let number = Int(component), number >= 0 && number <= 255 {
            continue
        } else {
            return false
        }
    }

    return true
}

func firstNonRepeatedCharacter(in string: String) -> Character? {
    var characterCount: [Character: Int] = [:]

    for character in string {
        characterCount[character] = (characterCount[character] ?? 0) + 1
    }

    for character in string {
        if characterCount[character] == 1 {
            return character
        }
    }

    return nil
}

