class TreeNode {
    var value: Int
    var leftChild: TreeNode?
    var rightChild: TreeNode?

    init(value: Int) {
        self.value = value
    }
}

class BinarySearchTree {
    private var root: TreeNode?

    func insert(_ value: Int) {
        root = insert(root, value)
    }

    private func insert(_ node: TreeNode?, _ value: Int) -> TreeNode {
        guard let node = node else { return TreeNode(value: value) }

        if value < node.value {
            node.leftChild = insert(node.leftChild, value)
        } else {
            node.rightChild = insert(node.rightChild, value)
        }
        return node
    }

    func delete(_ value: Int) {
        root = delete(root, value)
    }

    private func delete(_ node: TreeNode?, _ value: Int) -> TreeNode? {
        guard let node = node else { return nil }

        if value == node.value {
            if node.leftChild == nil {
                return node.rightChild
            } else if node.rightChild == nil {
                return node.leftChild
            } else {
                node.value = minValue(node.rightChild)
                node.rightChild = delete(node.rightChild, node.value)
            }
        } else if value < node.value {
            node.leftChild = delete(node.leftChild, value)
        } else {
            node.rightChild = delete(node.rightChild, value)
        }
        return node
    }

    private func minValue(_ node: TreeNode?) -> Int {
        var currentNode = node
        while let leftChild = currentNode?.leftChild {
            currentNode = leftChild
        }
        return currentNode?.value ?? -1
    }

    func search(_ value: Int) -> Bool {
        return search(root, value)
    }

    private func search(_ node: TreeNode?, _ value: Int) -> Bool {
        guard let node = node else { return false }

        if value == node.value {
            return true
        } else if value < node.value {
            return search(node.leftChild, value)
        } else {
            return search(node.rightChild, value)
        }
    }
}

