func romanToInt(_ s: String) -> Int {
    let romanDict: [Character: Int] = [
        "I": 1, "V": 5, "X": 10, "L": 50, "C": 100, "D": 500, "M": 1000
    ]

    var total = 0
    var prevValue = 0
    for char in s {
        let value = romanDict[char] ?? 0
        total += (value > prevValue) ? (value - 2 * prevValue) : value
        prevValue = value
    }

    return total
}

