func longestCommonPrefix(_ strs: [String]) -> String {
    guard !strs.isEmpty else { return "" }
    var prefix = strs[0]
    for str in strs {
        while !str.hasPrefix(prefix) {
            prefix.removeLast()
            if prefix.isEmpty {
                return ""
            }
        }
    }
    return prefix
}
print(longestCommonPrefix(["flower", "flow", "flight"]))

func maximumProduct(_ nums: [Int]) -> Int {
    let sortedNums = nums.sorted()
    let n = sortedNums.count
    let maxProduct = max(sortedNums[0] * sortedNums[1] * sortedNums[n - 1], sortedNums[n - 3] * sortedNums[n - 2] * sortedNums[n - 1])
    return maxProduct
}
print(maximumProduct([-10, -10, 1, 3, 2]))

func isPalindrome(_ s: String) -> Bool {
    let characters = Array(s)
    let count = characters.count
    for i in 0..<(count / 2) {
        if characters[i] != characters[count - i - 1] {
            return false
        }
    }
    return true
}
print(isPalindrome("level"))

func firstNonRepeatedInteger(_ arr: [Int]) -> Int? {
    var counts: [Int: Int] = [:]
    for num in arr {
        counts[num, default: 0] += 1
    }
    for num in arr {
        if let count = counts[num], count == 1 {
            return num
        }
    }
    return nil
}
