        let currentNode = unvisitedNodes.min { a, b in
            return shortestDistances[a, default: Int.max] < shortestDistances[b, default: Int.max]
        }
        guard let current = currentNode else { break }
        unvisitedNodes.remove(current)

        for (neighbor, distance) in graph[current, default: []] {
            let tentativeDistance = shortestDistances[current, default: Int.max] + distance
            if tentativeDistance < shortestDistances[neighbor, default: Int.max] {
                shortestDistances[neighbor] = tentativeDistance
                previousNodes[neighbor] = current
            }
        }
    }

    var path: [String] = []
    var currentNode: String? = end
    while currentNode != nil {
        path.insert(currentNode!, at: 0)
        currentNode = previousNodes[currentNode!]
    }

    return path
}
