    var maxChar: Character?
    var prevChar: Character?

    for char in input {
        if char == prevChar {
            currentLength += 1
        } else {
            currentLength = 1
            prevChar = char
        }

        if currentLength > maxLength {
            maxLength = currentLength
            maxChar = char
        }
    }

    return String(repeating: maxChar ?? " ", count: maxLength)
}

func largestContiguousSum(_ array: [Int]) -> Int {
    var maxSum = array[0]
    var currentSum = array[0]

    for i in 1..<array.count {
        currentSum = max(array[i], currentSum + array[i])
        maxSum = max(maxSum, currentSum)
    }

    return maxSum
}

func replaceCharacters(in string: String, with mappings: [Character: Character]) -> String {
    return string.map { mappings[$0] ?? $0 }.joined()
