func encrypt(input: String, shift: Int) -> String {
    let upperCaseA = UnicodeScalar("A").value
    let upperCaseZ = UnicodeScalar("Z").value
    let lowerCaseA = UnicodeScalar("a").value
    let lowerCaseZ = UnicodeScalar("z").value

    let shiftValue = UInt32(shift % 26)

    var encryptedString = ""

    for char in input.unicodeScalars {
        var encryptedValue = char.value

        if char.value >= upperCaseA && char.value <= upperCaseZ {
            encryptedValue = ((char.value - upperCaseA + shiftValue) % 26) + upperCaseA
        } else if char.value >= lowerCaseA && char.value <= lowerCaseZ {
            encryptedValue = ((char.value - lowerCaseA + shiftValue) % 26) + lowerCaseA
        }

        encryptedString.append(String(UnicodeScalar(encryptedValue)!))
    }

    return encryptedString
}

