class OnboardingViewController: UIPageViewController, UIPageViewControllerDataSource {

    lazy var onboardingPages: [UIViewController] = {
        let firstPage = storyboard!.instantiateViewController(withIdentifier: "FirstPage")
        let secondPage = storyboard!.instantiateViewController(withIdentifier: "SecondPage")
        let thirdPage = storyboard!.instantiateViewController(withIdentifier: "ThirdPage")

