class LocationManager: NSObject, CLLocationManagerDelegate {
    private let locationManager = CLLocationManager()

    typealias LocationCompletionHandler = (CLLocation?, Error?) -> Void
    private var locationCompletionHandler: LocationCompletionHandler?

    override init() {
        super.init()
        locationManager.delegate = self
    }

    func requestCurrentLocation(completion: @escaping LocationCompletionHandler) {
        locationManager.requestWhenInUseAuthorization()
        locationCompletionHandler = completion
        locationManager.requestLocation()
    }

    func locationManager(_ manager: CLLocationManager, didUpdateLocations locations: [CLLocation]) {
        locationCompletionHandler?(locations.first, nil)
    }

    func locationManager(_ manager: CLLocationManager, didFailWithError error: Error) {
        locationCompletionHandler?(nil, error)
    }
}

