struct DataItem: Codable {
    let id: Int
    let title: String
    let description: String
}

func fetchData(from urlString: String, completion: @escaping (Result<[DataItem], Error>) -> Void) {
    guard let url = URL(string: urlString) else {
        completion(.failure(NSError(domain: "", code: -1, userInfo: nil)))
        return
    }

    let task = URLSession.shared.dataTask(with: url) { data, response, error in
        if let error = error {
            completion(.failure(error))
            return
        }

        guard let data = data else {
            completion(.failure(NSError(domain: "", code: -2, userInfo: nil)))
            return
        }

        do {
            let decoder = JSONDecoder()
            let dataItems = try decoder.decode([DataItem].self, from: data)
            completion(.success(dataItems))
        } catch {
            completion(.failure(error))
        }
    }

    task.resume()
}

