    let textView = UITextView()
    let searchButton = UIButton(type: .system)
    let searchString = "example"

    override func viewDidLoad() {
        super.viewDidLoad()

        setupTextView()
        setupSearchButton()
    }

    func setupTextView() {
        textView.translatesAutoresizingMaskIntoConstraints = false
        textView.text = "This is an example text. This example will help demonstrate how to search and highlight text in UITextView."
        view.addSubview(textView)

        NSLayoutConstraint.activate([
            textView.topAnchor.constraint(equalTo: view.safeAreaLayoutGuide.topAnchor),
            textView.leadingAnchor.constraint(equalTo: view.leadingAnchor, constant: 16),
            textView.trailingAnchor.constraint(equalTo: view.trailingAnchor, constant: -16),
            textView.heightAnchor.constraint(equalToConstant: 200)
        ])
    }

    func setupSearchButton() {
        searchButton.translatesAutoresizingMaskIntoConstraints = false
        searchButton.setTitle("Search and Highlight", for: .normal)
        searchButton.addTarget(self, action: #selector(searchAndHighlight), for: .touchUpInside)
        view.addSubview(searchButton)

        NSLayoutConstraint.activate([
            searchButton.topAnchor.constraint(equalTo: textView.bottomAnchor, constant: 16),
            searchButton.centerXAnchor.constraint(equalTo: view.centerXAnchor)
        ])
    }

    @objc func searchAndHighlight() {
        let attributedText = NSMutableAttributedString(string: textView.text)
        let range = NSRange(location: 0, length: textView.text.count)
        let regex = try? NSRegularExpression(pattern: searchString, options: .caseInsensitive)

        regex?.enumerateMatches(in: textView.text, options: [], range: range) { (result, flags, stop) in
            if let matchRange = result?.range {
                let highlightAttributes: [NSAttributedString.Key: Any] = [
                    .backgroundColor: UIColor.yellow
                ]
                attributedText.addAttributes(highlightAttributes, range: matchRange)
            }
        }

        textView.attributedText = attributedText
    }
}

