class GridCollectionViewLayout: UICollectionViewLayout {

    private let numberOfColumns = 3
    private var itemHeights: [CGFloat] = []

    override func prepare() {
        guard let collectionView = collectionView else { return }
        itemHeights = (0..<collectionView.numberOfItems(inSection: 0)).map { _ in CGFloat(arc4random_uniform(50) + 50) }
    }

    override var collectionViewContentSize: CGSize {
        guard let collectionView = collectionView else { return .zero }
        let contentWidth = collectionView.bounds.width
        let numberOfRows = ceil(CGFloat(itemHeights.count) / CGFloat(numberOfColumns))
        let contentHeight = numberOfRows * itemSize.height
        return CGSize(width: contentWidth, height: contentHeight)
    }

    override func layoutAttributesForElements(in rect: CGRect) -> [UICollectionViewLayoutAttributes]? {
        return (0..<itemHeights.count).compactMap { index in
            let indexPath = IndexPath(item: index, section: 0)
            return layoutAttributesForItem(at: indexPath)
        }
    }

    override func layoutAttributesForItem(at indexPath: IndexPath) -> UICollectionViewLayoutAttributes? {
        guard let collectionView = collectionView else { return nil }
        let row = indexPath.item / numberOfColumns
        let column = indexPath.item % numberOfColumns
        let x = CGFloat(column) * itemSize.width
        let y = CGFloat(row) * itemSize.height
        let frame = CGRect(x: x, y: y, width: itemSize.width, height: itemHeights[indexPath.item])
        let attributes = UICollectionViewLayoutAttributes(forCellWith: indexPath)
        attributes.frame = frame
        return attributes
    }

    private var itemSize: CGSize {
        guard let collectionView = collectionView else { return .zero }
        let itemWidth = collectionView.bounds.width / CGFloat(numberOfColumns)
        let itemHeight: CGFloat = 100
        return CGSize(width: itemWidth, height: itemHeight)
    }
}

