        mapView.addAnnotation(annotation)
    }

    func mapView(_ mapView: MKMapView, viewFor annotation: MKAnnotation) -> MKAnnotationView? {
        guard let customAnnotation = annotation as? CustomAnnotation else { return nil }

        let reuseIdentifier = "CustomAnnotation"
        var annotationView = mapView.dequeueReusableAnnotationView(withIdentifier: reuseIdentifier)

        if annotationView == nil {
            annotationView = MKAnnotationView(annotation: customAnnotation, reuseIdentifier: reuseIdentifier)
            annotationView?.canShowCallout = false
        } else {
            annotationView?.annotation = customAnnotation
        }

        annotationView?.image = customAnnotation.image
        return annotationView
    }

    func mapView(_ mapView: MKMapView, didSelect view: MKAnnotationView) {
        guard let customAnnotation = view.annotation as? CustomAnnotation else { return }

        let calloutView = CustomCalloutView(annotation: customAnnotation)
        calloutView.center = CGPoint(x: view.bounds.midX, y: -(calloutView.bounds.height * 0.5))
        view.addSubview(calloutView)
    }

    func mapView(_ mapView: MKMapView, didDeselect view: MKAnnotationView) {
        if let customCalloutView = view.subviews.first(where: { $0 is CustomCalloutView }) {
            customCalloutView.removeFromSuperview()
        }
    }
