func searchForPlaces(near coordinate: CLLocationCoordinate2D, query: String, completion: @escaping (Result<[MKMapItem], Error>) -> Void) {
    let request = MKLocalSearch.Request()
    request.naturalLanguageQuery = query
    request.region = MKCoordinateRegion(center: coordinate, latitudinalMeters: 1000, longitudinalMeters: 1000)

    let search = MKLocalSearch(request: request)
    search.start { (response, error) in
        if let error = error {
            completion(.failure(error))
            return
        }

        guard let response = response else {
            completion(.failure(NSError(domain: "No response received", code: -1, userInfo: nil)))
            return
        }

        completion(.success(response.mapItems))
    }
}

