import CoreLocation

class LocationManager: NSObject, CLLocationManagerDelegate {
    static let shared = LocationManager()

    private let locationManager = CLLocationManager()

    private var locationCompletion: ((CLLocationCoordinate2D?) -> Void)?

    private override init() {
        super.init()
        locationManager.delegate = self
        locationManager.desiredAccuracy = kCLLocationAccuracyBest
    }

    func fetchCurrentLocation(completion: @escaping (CLLocationCoordinate2D?) -> Void) {
        locationManager.requestWhenInUseAuthorization()
        locationCompletion = completion
        locationManager.startUpdatingLocation()
    }

    func locationManager(_ manager: CLLocationManager, didUpdateLocations locations: [CLLocation]) {
        if let location = locations.first {
            locationCompletion?(location.coordinate)
            locationManager.stopUpdatingLocation()
        } else {
            locationCompletion?(nil)
        }
        locationCompletion = nil
    }
}

func getCurrentLocation(completion: @escaping (CLLocationCoordinate2D?) -> Void) {
    LocationManager.shared.fetchCurrentLocation(completion: completion)
}

