import Foundation

func jsonStringToDictionary(jsonString: String) -> [String: Any]? {
    guard let data = jsonString.data(using: .utf8) else { return nil }
    do {
        let jsonObject = try JSONSerialization.jsonObject(with: data, options: .allowFragments)
        guard let dictionary = jsonObject as? [String: Any] else { return nil }
        return dictionary
    } catch {
        print("Error converting JSON string to dictionary: \(error.localizedDescription)")
        return nil
    }
}

import UIKit

func createHorizontalScrollView(images: [UIImage]) -> UIScrollView {
    let scrollView = UIScrollView()
    scrollView.translatesAutoresizingMaskIntoConstraints = false
    scrollView.isPagingEnabled = true
    scrollView.showsHorizontalScrollIndicator = false

    let contentView = UIView()
    contentView.translatesAutoresizingMaskIntoConstraints = false
    scrollView.addSubview(contentView)

    var previousImageView: UIImageView?

    for image in images {
        let imageView = UIImageView(image: image)
        imageView.translatesAutoresizingMaskIntoConstraints = false
        imageView.contentMode = .scaleAspectFit

        contentView.addSubview(imageView)

        NSLayoutConstraint.activate([
            imageView.topAnchor.constraint(equalTo: contentView.topAnchor),
            imageView.bottomAnchor.constraint(equalTo: contentView.bottomAnchor),
            imageView.widthAnchor.constraint(equalTo: scrollView.widthAnchor)
        ])

        if let previousImageView = previousImageView {
            imageView.leadingAnchor.constraint(equalTo: previousImageView.trailingAnchor).isActive = true
        } else {
            imageView.leadingAnchor.constraint(equalTo: contentView.leadingAnchor).isActive = true
        }

        previousImageView = imageView
    }

    if let lastImageView = previousImageView {
        lastImageView.trailingAnchor.constraint(equalTo: contentView.trailingAnchor).isActive = true
    }

    NSLayoutConstraint.activate([
        contentView.topAnchor.constraint(equalTo: scrollView.topAnchor),
        contentView.bottomAnchor.constraint(equalTo: scrollView.bottomAnchor),
        contentView.leadingAnchor.constraint(equalTo: scrollView.leadingAnchor),
        contentView.trailingAnchor.constraint(equalTo: scrollView.trailingAnchor),
        contentView.heightAnchor.constraint(equalTo: scrollView.heightAnchor)
    ])

    return scrollView
}

