import UserNotifications

func scheduleLocalNotification(withTitle title: String, body: String) {
    let center = UNUserNotificationCenter.current()
    let content = UNMutableNotificationContent()
    content.title = title
    content.body = body
    content.sound = UNNotificationSound.default

    let trigger = UNTimeIntervalNotificationTrigger(timeInterval: 5, repeats: false)
    let request = UNNotificationRequest(identifier: UUID().uuidString, content: content, trigger: trigger)
    center.add(request) { (error) in
        if let error = error {
            print("Error scheduling notification: \(error.localizedDescription)")
        }
    }
}

// Don't forget to request notification permission from the user.
func requestNotificationPermission() {
    let center = UNUserNotificationCenter.current()
    center.requestAuthorization(options: [.alert, .sound]) { granted, error in
        if let error = error {
            print("Error requesting notification permission: \(error.localizedDescription)")
        }
    }
}

// Call requestNotificationPermission() before trying to schedule a local notification.
requestNotificationPermission()
scheduleLocalNotification(withTitle: "Example Title", body: "Example Body")

