class HorizontalButtonScrollViewController: UIViewController {
    let scrollView = UIScrollView()
    let buttonTitles = ["Button 1", "Button 2", "Button 3", "Button 4"]

    override func viewDidLoad() {
        super.viewDidLoad()
        setupScrollView()
        addButtonsToScrollView()
    }

    func setupScrollView() {
        scrollView.translatesAutoresizingMaskIntoConstraints = false
        view.addSubview(scrollView)
        NSLayoutConstraint.activate([
            scrollView.leadingAnchor.constraint(equalTo: view.leadingAnchor),
            scrollView.trailingAnchor.constraint(equalTo: view.trailingAnchor),
            scrollView.centerYAnchor.constraint(equalTo: view.centerYAnchor),
            scrollView.heightAnchor.constraint(equalToConstant: 50)
        ])
    }

    func addButtonsToScrollView() {
        var previousButton: UIButton?

        for title in buttonTitles {
            let button = UIButton(type: .system)
            button.setTitle(title, for: .normal)
            button.translatesAutoresizingMaskIntoConstraints = false
            scrollView.addSubview(button)

            NSLayoutConstraint.activate([
                button.topAnchor.constraint(equalTo: scrollView.topAnchor),
                button.bottomAnchor.constraint(equalTo: scrollView.bottomAnchor),
                button.widthAnchor.constraint(equalToConstant: 100)
            ])

            if let previousButton = previousButton {
                button.leadingAnchor.constraint(equalTo: previousButton.trailingAnchor, constant: 10).isActive = true
            } else {
                button.leadingAnchor.constraint(equalTo: scrollView.leadingAnchor, constant: 10).isActive = true
            }

            previousButton = button
        }

        if let previousButton = previousButton {
            previousButton.trailingAnchor.constraint(equalTo: scrollView.trailingAnchor, constant: -10).isActive = true
        }
    }
}

