    @IBAction func filterEvents(_ sender: UISegmentedControl) {
        let now = Date()
        let calendar = Calendar.current
        let oneDayAgo = calendar.date(byAdding: .day, value: -1, to: now)
        let oneWeekAgo = calendar.date(byAdding: .weekOfYear, value: -1, to: now)

        switch sender.selectedSegmentIndex {
        case 0:
            filteredEvents = events
        case 1:
            filteredEvents = events.filter { $0.date >= (oneDayAgo ?? now) }
        case 2:
            filteredEvents = events.filter { $0.date >= (oneWeekAgo ?? now) }
        default:
            break
        }
        tableView.reloadData()
    }
