func saveDataToPlist<T: Encodable>(_ data: T, fileName: String) {
    let documentsDirectory = FileManager.default.urls(for: .documentDirectory, in: .userDomainMask).first!
    let fileURL = documentsDirectory.appendingPathComponent(fileName).appendingPathExtension("plist")

    do {
        let data = try PropertyListEncoder().encode(data)
        try data.write(to: fileURL)
    } catch {
        print("Error saving data to plist: \(error)")
    }
}

func loadDataFromPlist<T: Decodable>(_ type: T.Type, fileName: String) -> T? {
    let documentsDirectory = FileManager.default.urls(for: .documentDirectory, in: .userDomainMask).first!
    let fileURL = documentsDirectory.appendingPathComponent(fileName).appendingPathExtension("plist")

    do {
        let data = try Data(contentsOf: fileURL)
        let decodedData = try PropertyListDecoder().decode(type, from: data)
        return decodedData
    } catch {
        print("Error loading data from plist: \(error)")
        return nil
    }
}

