import UIKit

func compressImage(_ image: UIImage, to sizeInKB: Int) -> Data? {
    let sizeInBytes = sizeInKB * 1024
    let data = image.jpegData(compressionQuality: 1.0)

    guard var imageData = data, imageData.count > sizeInBytes else {
        return data
    }

    var compression: CGFloat = 0.9
    let minCompression: CGFloat = 0.1
    while imageData.count > sizeInBytes && compression > minCompression {
        compression -= 0.1
        guard let compressedData = image.jpegData(compressionQuality: compression) else { break }
        imageData = compressedData
    }

    return imageData
}

