func saveImageToPhotoLibrary(image: UIImage, completion: @escaping (Result<PHAsset, Error>) -> Void) {
    PHPhotoLibrary.shared().performChanges({
        let creationRequest = PHAssetCreationRequest.forAsset()
        creationRequest.addResource(with: .photo,data: image.pngData()!, options: nil)
    }) { success, error in
        if let error = error {
            completion(.failure(error))
            return
        }

        guard success else {
            completion(.failure(NSError(domain: "Image saving failed", code: -1, userInfo: nil)))
            return
        }

        let fetchOptions = PHFetchOptions()
        fetchOptions.sortDescriptors = [NSSortDescriptor(key: "creationDate", ascending: false)]
