func downloadImage(from urlString: String, completion: @escaping (Result<UIImage, Error>) -> Void) {
    guard let url = URL(string: urlString) else {
        let error = NSError(domain: "", code: 0, userInfo: [NSLocalizedDescriptionKey: "Invalid URL"])
        completion(.failure(error))
        return
    }

    let task = URLSession.shared.dataTask(with: url) { data, response, error in
        if let error = error {
            completion(.failure(error))
            return
        }

        guard let data = data, let image = UIImage(data: data) else {
            let error = NSError(domain: "", code: 0, userInfo: [NSLocalizedDescriptionKey: "Failed to download image"])
            completion(.failure(error))
            return
        }

        completion(.success(image))
    }
    task.resume()
}

