func createCircularProgressBar(progress: CGFloat, radius: CGFloat, width: CGFloat) -> UIView {
    let progressBar = UIView(frame: CGRect(x: 0, y: 0, width: radius * 2, height: radius * 2))

    let backgroundLayer = CAShapeLayer()
    let backgroundPath = UIBezierPath(arcCenter: progressBar.center, radius: radius, startAngle: 0, endAngle: 2 * CGFloat.pi, clockwise: true)
    backgroundLayer.path = backgroundPath.cgPath
    backgroundLayer.strokeColor = UIColor.lightGray.cgColor
    backgroundLayer.fillColor = UIColor.clear.cgColor
    backgroundLayer.lineWidth = width
    progressBar.layer.addSublayer(backgroundLayer)

    let progressLayer = CAShapeLayer()
    let progressPath =UIBezierPath(arcCenter: progressBar.center, radius: radius, startAngle: -CGFloat.pi / 2, endAngle: (2 * CGFloat.pi) * progress - CGFloat.pi / 2, clockwise: true)
    progressLayer.path = progressPath.cgPath
    progressLayer.strokeColor = UIColor.blue.cgColor
    progressLayer.fillColor = UIColor.clear.cgColor
    progressLayer.lineWidth = width
    progressLayer.lineCap = .round
    progressBar.layer.addSublayer(progressLayer)

    return progressBar
}

