class StarRatingControl: UIControl {
    var rating = 0 {
        didSet {
            updateButtons()
        }
    }
    private var buttons = [UIButton]()
    private let starCount = 5

    override init(frame: CGRect) {
        super.init(frame: frame)
        setupButtons()
    }

    required init?(coder: NSCoder) {
        super.init(coder: coder)
        setupButtons()
    }

    private func setupButtons() {
        for _ in 0..<starCount {
            let button = UIButton()
            button.setImage(UIImage(named: "emptyStar"), for: .normal)
            button.setImage(UIImage(named: "filledStar"), for: .selected)
            button.addTarget(self, action: #selector(buttonTapped), for: .touchUpInside)
            addSubview(button)
            buttons.append(button)
        }
        updateButtons()
    }

    override func layoutSubviews() {
        let buttonSize = bounds.width / CGFloat(starCount)
        for (index, button) in buttons.enumerated() {
            button.frame = CGRect(x: CGFloat(index) * buttonSize, y: 0, width: buttonSize, height: bounds.height)
        }
