class CircularProgressView: UIView {
    private var progressLayer: CAShapeLayer!
    private var backgroundLayer: CAShapeLayer!
    private let percentageLabel: UILabel = {
        let label = UILabel()
        label.translatesAutoresizingMaskIntoConstraints = false
        label.textAlignment = .center
        return label
    }()

    var progress: CGFloat = 0 {
        didSet {
            updateProgress()
        }
    }

    override init(frame: CGRect) {
        super.init(frame: frame)
        setup()
    }

    required init?(coder: NSCoder) {
        super.init(coder: coder)
        setup()
    }

    private func setup() {
        backgroundLayer = createCircularLayer(strokeColor: UIColor.lightGray.cgColor)
        progressLayer = createCircularLayer(strokeColor: UIColor.red.cgColor)
        layer.addSublayer(backgroundLayer)
        layer.addSublayer(progressLayer)
        addSubview(percentageLabel)

        NSLayoutConstraint.activate([
            percentageLabel.centerXAnchor.constraint(equalTo: centerXAnchor),
            percentageLabel.centerYAnchor.constraint(equalTo: centerYAnchor)
        ])
    }

    override func layoutSubviews() {
        super.layoutSubviews()
        backgroundLayer.path = createCircularPath().cgPath
        progressLayer.path = createCircularPath().cgPath
        updateProgress()
    }

    private func createCircularLayer(strokeColor: CGColor) -> CAShapeLayer {
        let layer = CAShapeLayer()
        layer.strokeColor = strokeColor
        layer.lineWidth = 10
        layer.fillColor = UIColor.clear.cgColor
        layer.lineCap = .round
        return layer
    }

    private func createCircularPath() -> UIBezierPath {
        return UIBezierPath(arcCenter: CGPoint(x: bounds.midX, y: bounds.midY), radius: bounds.width / 2 - 10, startAngle: -CGFloat.pi / 2, endAngle: 3 * CGFloat.pi / 2, clockwise: true)
    }

    private func updateProgress() {
        progressLayer.strokeEnd = progress
        percentageLabel.text = "\(Int(progress * 100))%"
    }
}

