class StarRatingControl: UIControl {
    var rating: Int = 0 {
        didSet {
            setNeedsLayout()
        }
    }

    private var starButtons: [UIButton] = []
    private let starCount = 5
    private let starSpacing: CGFloat = 8

    override init(frame: CGRect) {
        super.init(frame: frame)
        setupStarButtons()
    }

    required init?(coder: NSCoder) {
        super.init(coder: coder)
        setupStarButtons()
    }

    private func setupStarButtons() {
        for _ in 0..<starCount {
            let button = UIButton()
            button.setImage(UIImage(named: "emptyStar"), for: .normal)
            button.setImage(UIImage(named: "filledStar"), for: .selected)
            button.addTarget(self, action: #selector(starButtonTapped), for: .touchUpInside)
            addSubview(button)
            starButtons.append(button)
        }
    }

    override func layoutSubviews() {
        let buttonSize = Int(bounds.width) / (starCount * (Int(starSpacing) + 1))
        var buttonFrame = CGRect(x: 0, y: 0, width: buttonSize, height: buttonSize)

        for (index, button) in starButtons.enumerated() {
            buttonFrame.origin.x = CGFloat(index * (buttonSize + Int(starSpacing)))
            button.frame = buttonFrame
            button.isSelected = index < rating
        }
    }

    @objc func starButtonTapped(_ sender: UIButton) {
        guard let index = starButtons.firstIndex(of: sender) else { return }
        rating = index + 1
        sendActions(for: .valueChanged)
    }
}

