import UIKit

class VariableWidthGridLayout: UICollectionViewLayout {
    private var cache: [UICollectionViewLayoutAttributes] = []
    private var contentWidth: CGFloat = 0
    private let rowHeight: CGFloat = 100

    override var collectionViewContentSize: CGSize {
        return CGSize(width: contentWidth, height: rowHeight * CGFloat(collectionView!.numberOfSections))
    }

    override func prepare() {
        guard cache.isEmpty, let collectionView = collectionView else { return }

        var xOffset: CGFloat = 0
        for item in 0..<collectionView.numberOfItems(inSection: 0) {
            let indexPath = IndexPath(item: item, section: 0)
            let columnWidth = CGFloat(100 * (item % 2 + 1))
            let frame = CGRect(x: xOffset, y: 0, width: columnWidth, height: rowHeight)
            let attributes = UICollectionViewLayoutAttributes(forCellWith: indexPath)
            attributes.frame = frame
            cache.append(attributes)

            xOffset += columnWidth
            contentWidth = max(contentWidth, xOffset)
        }
    }

    override func layoutAttributesForElements(in rect: CGRect) -> [UICollectionViewLayoutAttributes]? {
        return cache.filter { $0.frame.intersects(rect) }
    }

    override func layoutAttributesForItem(at indexPath: IndexPath) -> UICollectionViewLayoutAttributes? {
        return cache[indexPath.item]
    }
}

