import FirebaseMessaging

func sendPushNotification(to token: String, title: String, body: String, completion: @escaping (Error?) -> Void) {
    let message: [String: Any] = [
        "to": token,
        "notification": [
            "title": title,
            "body": body
        ]
    ]

    var request = URLRequest(url: URL(string: "https://fcm.googleapis.com/fcm/send")!)
    request.httpMethod = "POST"
    request.setValue("application/json", forHTTPHeaderField: "Content-Type")
    request.setValue("key=\(ServerKey)", forHTTPHeaderField: "Authorization")
    request.httpBody = try? JSONSerialization.data(withJSONObject: message, options: .prettyPrinted)

    let task = URLSession.shared.dataTask(with: request) { data, response, error in
        completion(error)
    }
    task.resume()
}

import CoreLocation

class LocationManager: NSObject, CLLocationManagerDelegate {
    private let locationManager = CLLocationManager()
    private var locationCallback: ((CLLocationCoordinate2D?) -> Void)?

    func fetchUserLocation(completion: @escaping (CLLocationCoordinate2D?) -> Void) {
        locationManager.delegate = self
        locationManager.desiredAccuracy = kCLLocationAccuracyBest
        locationManager.requestWhenInUseAuthorization()
        locationManager.startUpdatingLocation()
        locationCallback = completion
    }

    func locationManager(_ manager: CLLocationManager, didUpdateLocations locations: [CLLocation]) {
        if let location = locations.last {
            locationManager.stopUpdatingLocation()
            locationCallback?(location.coordinate)
            locationManager.delegate = nil
        }
    }

    func locationManager(_ manager: CLLocationManager, didFailWithError error: Error) {
        locationManager.stopUpdatingLocation()
        locationCallback?(nil)
        locationManager.delegate = nil
    }
}

