class StickyHeadersCollectionViewLayout: UICollectionViewFlowLayout {
    override func layoutAttributesForElements(in rect: CGRect) -> [UICollectionViewLayoutAttributes]? {
        let layoutAttributes = super.layoutAttributesForElements(in: rect)?.map { $0.copy() } as? [UICollectionViewLayoutAttributes]
        guard let collectionView = collectionView, let attributes = layoutAttributes else { return layoutAttributes }

        for attribute in attributes {
            if attribute.representedElementKind == UICollectionView.elementKindSectionHeader {
                let section = attribute.indexPath.section
                let numberOfItemsInSection = collectionView.numberOfItems(inSection: section)

                let firstCellIndexPath = IndexPath(item: 0, section: section)
                let lastCellIndexPath = IndexPath(item: max(0, numberOfItemsInSection - 1), section: section)

                let firstCellAttributes = layoutAttributesForItem(at: firstCellIndexPath)
                let lastCellAttributes = layoutAttributesForItem(at: lastCellIndexPath)

                let leftEdge = collectionView.contentInset.left
                let rightEdge = collectionView.frame.width - collectionView.contentInset.right

                let headerWidth = attribute.frame.width
                let minX = firstCellAttributes?.frame.minX ?? 0
                let maxX = (lastCellAttributes?.frame.maxX ?? 0) - headerWidth

                let leftAlignedX = max(minX, leftEdge)
                let rightAlignedX = min(maxX, rightEdge - headerWidth)

                attribute.frame.origin.x = leftAlignedX + (rightAlignedX - leftAlignedX) * collectionView.contentOffset.x / (collectionView.contentSize.width - collectionView.frame.width)
                attribute.zIndex = 1024
            }
        }

        return attributes
    }

    override func shouldInvalidateLayout(forBoundsChange newBounds: CGRect) -> Bool {
        return true
    }
}

