class LoopingPageViewController: UIPageViewController, UIPageViewControllerDataSource, UIPageViewControllerDelegate {
    private var viewControllersList: [UIViewController] = []

    init(viewControllersList: [UIViewController]) {
        self.viewControllersList = viewControllersList
        super.init(transitionStyle: .scroll, navigationOrientation: .horizontal, options: nil)
    }

    required init?(coder: NSCoder) {
        fatalError("init(coder:) has not been implemented")
    }

    override func viewDidLoad() {
        super.viewDidLoad()
        self.dataSource = self
        self.delegate = self

        if let firstViewController = viewControllersList.first {
            setViewControllers([firstViewController], direction: .forward, animated: true, completion: nil)
        }
    }

    func pageViewController(_ pageViewController: UIPageViewController, viewControllerBefore viewController: UIViewController) -> UIViewController? {
        guard let currentIndex = viewControllersList.firstIndex(of: viewController) else { return nil }
        let previousIndex = (currentIndex - 1 + viewControllersList.count) % viewControllersList.count
        return viewControllersList[previousIndex]
    }

    func pageViewController(_ pageViewController: UIPageViewController, viewControllerAfter viewController: UIViewController) -> UIViewController? {
        guard let currentIndex = viewControllersList.firstIndex(of: viewController) else { return nil }
        let nextIndex = (currentIndex + 1) % viewControllersList.count
        return viewControllersList[nextIndex]
    }
}

