class NotesViewController: UIViewController, UITableViewDataSource {

    @IBOutlet weak var tableView: UITableView!

    var notes: [NSManagedObject] = []

    override func viewDidLoad() {
        super.viewDidLoad()
        tableView.dataSource = self
        fetchNotes()
    }

    func fetchNotes() {
        guard let appDelegate = UIApplication.shared.delegate as? AppDelegate else { return }
        let managedContext = appDelegate.persistentContainer.viewContext
        let fetchRequest = NSFetchRequest<NSManagedObject>(entityName: "Note")

        do {
            notes = try managedContext.fetch(fetchRequest)
            tableView.reloadData()
       } catch let error as NSError {
            print("Error fetching notes: \(error), \(error.userInfo)")
        }
    }

    @IBAction func addNoteButtonTapped(_ sender: UIBarButtonItem) {
        let alertController = UIAlertController(title: "New Note", message: "Enter a note", preferredStyle: .alert)
        alertController.addTextField()
        let saveAction = UIAlertAction(title: "Save", style: .default) { [unowned self] action in
            guard let textField = alertController.textFields?.first, let noteText = textField.text else { return }
            self.save(noteText: noteText)
        }
        let cancelAction = UIAlertAction(title: "Cancel", style: .cancel)

        alertController.addAction(saveAction)
        alertController.addAction(cancelAction)
        present(alertController, animated: true)
    }

    func save(noteText: String) {
        guard let appDelegate = UIApplication.shared.delegate as? AppDelegate else { return }
        let managedContext = appDelegate.persistentContainer.viewContext
        let entity = NSEntityDescription.entity(forEntityName: "Note", in: managedContext)!
        let note = NSManagedObject(entity: entity, insertInto: managedContext)

        note.setValue(noteText, forKey: "text")

        do {
            try managedContext.save()
            notes.append(note)
            tableView.reloadData()
        } catch let error as NSError {
            print("Error saving note: \(error), \(error.userInfo)")
        }
    }

    func tableView(_ tableView: UITableView, numberOfRowsInSection section: Int) -> Int {
        return notes.count
    }

    func tableView(_ tableView: UITableView, cellForRowAt indexPath: IndexPath) -> UITableViewCell {
        let cell = tableView.dequeueReusableCell(withIdentifier: "NoteCell", for: indexPath)
        let note = notes[indexPath.row]
        cell.textLabel?.text = note.value(forKey: "text") as? String
        return cell
    }
}

