func timeDifference(from startDate: Date, to endDate: Date)-> String {
    let components = Calendar.current.dateComponents([.year, .month, .day, .hour, .minute, .second], from: startDate, to: endDate)

    let formatter = DateComponentsFormatter()
    formatter.unitsStyle = .full
    formatter.allowedUnits = [.year, .month, .day, .hour, .minute, .second]
    formatter.maximumUnitCount = 2

    guard let formattedString = formatter.string(from: components) else {
        return "Invalid time difference"
    }

    return formattedString
}

