class RatingControl: UIControl {
    var rating = 0 {
        didSet {
            setNeedsLayout()
        }
    }

    private var starButtons = [UIButton]()

    override init(frame: CGRect) {
        super.init(frame: frame)
        setupStars()
    }

    required init?(coder: NSCoder) {
        super.init(coder: coder)
        setupStars()
    }

    private func setupStars() {
        for _ in 0..<5 {
            let button = UIButton()
            button.setImage(UIImage(systemName: "star.fill"), for: .selected)
            button.setImage(UIImage(systemName: "star"), for: .normal)
            button.translatesAutoresizingMaskIntoConstraints = false
            button.addTarget(self, action: #selector(ratingButtonTapped(button:)), for: .touchUpInside)
            addSubview(button)
            starButtons.append(button)
        }

        var constraints = [NSLayoutConstraint]()
        for (index, button) in starButtons.enumerated() {
            constraints += [
                button.widthAnchor.constraint(equalToConstant: 44),
                button.heightAnchor.constraint(equalToConstant: 44),
                button.centerYAnchor.constraint(equalTo: centerYAnchor)
            ]

            if index == 0 {
                constraints.append(button.leadingAnchor.constraint(equalTo: leadingAnchor))
            } else {
                constraints.append(button.leadingAnchor.constraint(equalTo: starButtons[index - 1].trailingAnchor))
            }
        }
        NSLayoutConstraint.activate(constraints)
    }

    @objc func ratingButtonTapped(button: UIButton) {
        if let index = starButtons.firstIndex(of: button) {
            rating = index + 1
            updateStarSelectionStates()
        }
    }

    private func updateStarSelectionStates() {
        for (index, button) in starButtons.enumerated() {
            button.isSelected = index < rating
        }
    }
