                        completion(.failure(error))
                    } else {
                        completion(.success(()))
                    }
                }
            } catch {
                completion(.failure(error))
            }
        }
    }

    let status = PHPhotoLibrary.authorizationStatus()

    if status == .authorized {
        save()
    } else if status == .notDetermined {
