            if newStatus == .authorized {
                save()
            } else {
                completion(.failure(NSError(domain: "Permission denied", code: -1, userInfo: nil)))
            }
        }
    } else {
        completion(.failure(NSError(domain: "Permission not granted", code: -1, userInfo: nil)))
    }
