func loginUser(username: String, password: String, completion: @escaping (Bool, String?) -> Void) {
    let url = URL(string: "https://your-api/login")!
    var request = URLRequest(url: url)
    request.httpMethod = "POST"

    let body = "username=\(username)&password=\(password)"
    request.httpBody = body.data(using: .utf8)

    let task = URLSession.shared.dataTask(with: request) { data, response, error in
        guard let data = data, error == nil,
              let httpResponse = response as? HTTPURLResponse,
              httpResponse.statusCode == 200 else {
            completion(false, "Request failed: \(String(describing: error))")
            return
        }

        do {
            let json = try JSONSerialization.jsonObject(with: data, options: [])
            guard let jsonObject = json as? [String: Any],
                  let token = jsonObject["token"] as? String else {
                completion(false, "Invalid response")
                return
            }
            completion(true, token)
        } catch {
            completion(false, "Error parsing response")
        }
    }
    task.resume()
}

