class CircularProgressView: UIView {
    private var progressLayer = CAShapeLayer()
    private var backgroundLayer = CAShapeLayer()
    private(set) var progress: CGFloat = 0

    var lineWidth: CGFloat = 10 {
        didSet {
            updateLayers()
        }
    }

    var progressColor: UIColor = .blue {
        didSet {
            progressLayer.strokeColor = progressColor.cgColor
        }
    }

    var backgroundColor: UIColor = .lightGray {
        didSet {
            backgroundLayer.strokeColor = backgroundColor.cgColor
        }
    }

    override init(frame: CGRect) {
        super.init(frame: frame)
        setupLayers()
    }

    required init?(coder: NSCoder) {
        super.init(coder: coder)
        setupLayers()
    }

    private func setupLayers() {
        backgroundLayer.strokeColor = backgroundColor.cgColor
        backgroundLayer.fillColor = nil
        backgroundLayer.lineCap = .round
        layer.addSublayer(backgroundLayer)

        progressLayer.strokeColor = progressColor.cgColor
        progressLayer.fillColor = nil
        progressLayer.lineCap = .round
        layer.addSublayer(progressLayer)

        updateLayers()
    }

    private func updateLayers() {
        backgroundLayer.lineWidth = lineWidth
        progressLayer.lineWidth = lineWidth

        let center = CGPoint(x: bounds.midX, y: bounds.midY)
        let radius = min(bounds.width, bounds.height) / 2 - lineWidth / 2
        let startAngle: CGFloat = -.pi / 2
        let endAngle: CGFloat = startAngle + 2 * .pi

        let path = UIBezierPath(arcCenter: center, radius: radius, startAngle: startAngle, endAngle: endAngle, clockwise: true)
        backgroundLayer.path = path.cgPath

        let progressPath = UIBezierPath(arcCenter: center, radius: radius, startAngle: startAngle, endAngle: startAngle + 2 * .pi * progress, clockwise: true)
        progressLayer.path = progressPath.cgPath
    }

    func setProgress(_ progress: CGFloat, animated: Bool) {
        self.progress = min(max(progress, 0), 1)
        let endAngle: CGFloat = -.pi / 2 + 2 * .pi * self.progress
        let center = CGPoint(x: bounds.midX, y: bounds.midY)
        let radius = min(bounds.width, bounds.height) / 2 - lineWidth / 2

        if animated {
            let animation = CABasicAnimation(keyPath: "path")
            animation.fromValue = progressLayer.path
            let newPath = UIBezierPath(arcCenter: center, radius: radius, startAngle: -.pi / 2, endAngle: endAngle, clockwise: true)
            animation.toValue = newPath.cgPath
            animation.duration = 0.25
            progressLayer.add(animation, forKey: "path")
        }

        let progressPath = UIBezierPath(arcCenter: center, radius: radius, startAngle: -.pi / 2, endAngle: endAngle, clockwise: true)
        progressLayer.path = progressPath.cgPath
    }

    override func layoutSubviews() {
        super.layoutSubviews()
        backgroundLayer.frame = bounds
        progressLayer.frame = bounds
        updateLayers()
    }
}

