class NotificationCenter {

    static let shared = NotificationCenter()

    private var observers: [String: [(AnyObject, Selector)]] = [:]

    private init() {}

    func addObserver(_ observer: AnyObject, selector: Selector, name: String) {
        if observers[name] == nil {
            observers[name] = []
        }
        observers[name]?.append((observer, selector))
    }

    func removeObserver(_ observer: AnyObject, name: String) {
        observers[name]?.removeAll(where: { $0.0 === observer })
    }

    func post(name: String) {
        observers[name]?.forEach { observer, selector in
            _ = observer.perform(selector)
        }
    }
}

