class CustomTableViewController: UITableViewController, UISearchBarDelegate {
    let cellIdentifier = "customCell"
    var dataArray = ["Apple", "Banana", "Grape", "Orange", "Peach", "Strawberry", "Watermelon"]
    var filteredDataArray: [String] = []
    var isSearching = false

    override func viewDidLoad() {
        super.viewDidLoad()

        let searchBar = UISearchBar()
        searchBar.searchBarStyle = .minimal
        searchBar.placeholder = "Search"
        searchBar.delegate = self
        navigationItem.titleView = searchBar

        tableView.register(UITableViewCell.self, forCellReuseIdentifier: cellIdentifier)
    }

    // MARK: - UITableViewDataSource

    override func tableView(_ tableView: UITableView, numberOfRowsInSection section: Int) -> Int {
        return isSearching ? filteredDataArray.count : dataArray.count
    }

    override func tableView(_ tableView: UITableView, cellForRowAt indexPath: IndexPath) -> UITableViewCell {
        let cell = tableView.dequeueReusableCell(withIdentifier: cellIdentifier, for: indexPath)

        let data = isSearching ? filteredDataArray[indexPath.row] : dataArray[indexPath.row]
        cell.textLabel?.text = data

        return cell
    }

    // MARK: - UISearchBarDelegate

    func searchBar(_ searchBar: UISearchBar, textDidChange searchText: String) {
        if searchText.isEmpty {
            isSearching = false
            tableView.reloadData()
        } else {
            isSearching = true
            filteredDataArray = dataArray.filter { $0.lowercased().contains(searchText.lowercased()) }
            tableView.reloadData()
        }
    }
}

