import Foundation

func generateRandomPassword(_ length: Int) -> String {
    let uppercaseLetters = Array("ABCDEFGHIJKLMNOPQRSTUVWXYZ")
    let lowercaseLetters = Array("abcdefghijklmnopqrstuvwxyz")
    let digits = Array("0123456789")

    var password = [Character]()
    password.append(uppercaseLetters.randomElement()!)
    password.append(lowercaseLetters.randomElement()!)
    password.append(digits.randomElement()!)

    while password.count < length {
        password.append([uppercaseLetters, lowercaseLetters, digits].flatMap { $0 }.randomElement()!)
    }

    password.shuffle()

    return String(password)
}

